let initialState = {
	friendsList: [
			{ id: 0, name: "Даун Иваныч" },
			{ id: 1, name: "Даун Лохыч" }
			]
}

const navBarReducer = (state = initialState, action) => {
	
	return state;
}

export default navBarReducer;
